MultiLanguageSpellData['es'][84411] = {name = "[q3]Pistola de descarga de gran potencia", additional_info = "Hechizo de 4 seg 5\nHerramientas: Martillo de herrero , Microajustador giromático\nComponentes:\nBarra de obsidium (10), Puñado de tornillos de obsidium (8), Éter electrificado (4)\n[q3]Pistola de descarga de gran potencia\nSe liga al usarlo\nRequiereIngeniería\n(450)\n[q2]Uso: Dispara varios tornillos cargados a un enemigo que infligen 8860 p. de daño e interrumpen brevemente el lanzamiento. Consume un puñado de tornillos de obsidium cada vez que se dispara. (2 Min Reutilización)\n[q]\"Casi tan complicada de hacer que funcione como de fabricarla.\""}
