MultiLanguageSpellData['es'][84416] = {name = "[q3]Caja de herramientas de elementium", additional_info = "Hechizo de 5 seg 5\nHerramientas: Martillo de herrero\nComponentes:\nBarra de elementium (15), Tierra volátil (12)\n[q3]Caja de herramientas de elementium\nSe liga al equiparlo\nBolsa de ingeniería de 36 casillas\n[q]\"Posiblemente la mejor caja de herramientas jamás hecha, adornada con incrustaciones de oro.\""}
MultiLanguageSpellData['es'][84417] = {name = "[q3]Truenopalo volátil", additional_info = "Hechizo de 2 seg 5\nHerramientas: Martillo de herrero , Microajustador giromático\nComponentes:\nÉter electrificado (2), Barra de elementium endurecido (5), Fuego volátil (6)\n[q3]Truenopalo volátil\nSe liga al equiparlo\nA distancia Arma de fuego\n958 - 1,781 Daño Velocidad 2.80\n(489.11 daño por segundo)\n+84 agilidad\n+126 aguante\n[q2]Aumenta tu índice de maestría + 56 p.\nDurabilidad 75 / 75\nNecesitas ser de nivel 83\n[q2]Equipar: Mejora el índice de golpe crítico en 56 p."}
MultiLanguageSpellData['es'][84418] = {name = "[q3]Dragonizo de elementium", additional_info = "Hechizo de 2 seg 5\nHerramientas: Martillo de herrero , Pistola de descarga de gran potencia\nComponentes:\nPuñado de tornillos de obsidium (2), Éter electrificado (8), Barra de elementium (16), Paño de seda de ascuas (20)\n[q3]Dragonizo de elementium\nSe liga al equiparlo\nÚnico-EquipadoAbalorio\n[q2]Aumenta tu índice de maestría + 252 p.\nNecesitas ser de nivel 80\nRequiereIngeniería\n(475)\n[q2]Uso: Activa tu dragonizo de elementium para que luche por ti durante 1 min. (5 Min Reutilización)"}
