MultiLanguageSpellData['es'][84424] = {name = "Campo de invisibilidad", additional_info = "Hechizo de 5 seg\nRequiere Cinturón\nHerramientas: Llave de tuerca arcoluz\nComponentes:\nPuñado de tornillos de obsidium , Éter electrificado\n[q]Añade de forma permanente miles de espejitos a tu cinturón que te permiten volverte invisible cuando no estás en combate. Solo se puede activar una vez cada 5 min.\n\n Solo se puede usar con tu propio cinturón, y hacerlo provoca que se ligue. Usarlo requiere una habilidad en ingeniería de al menos 500 p."}
MultiLanguageSpellData['es'][84425] = {name = "Asesino de cartón", additional_info = "Hechizo de 5 seg\nRequiere Cinturón\nHerramientas: Llave de tuerca arcoluz\nComponentes:\nMadera simple (2), Puñado de tornillos de obsidium\n[q]Añade de forma permanente un artilugio diminuto a tu cinturón que te permite crear un asesino de cartón al que atacarán tus enemigos. Dura 15 sec. Se puede utilizar una vez cada 5 min.\n\n Solo se puede usar con tu propio cinturón y hacerlo provoca que se ligue. Requiere una habilidad en ingeniería de al menos 500 p."}
