MultiLanguageSpellData['es'][86470] = {name = "Maestría", additional_info = "[q]Te permite beneficiarte del índice de maestría.\n\nOleada de estrellas\nEclipse total\n Aumenta un 16% el bonus de daño de Eclipse. Cada punto de maestría aumenta el bonus un 2.0% extra\n\n\n\nDestrozar\nDefensor salvaje\n Aumenta un 32% el daño absorbido por tu facultad Defensor salvaje. Cada punto de maestría aumenta la absorción un 4% extra.\n\nGarras tajantes\n Aumenta un 25% el daño infligido por tus facultades de sangrado de forma felina. Cada punto de maestría aumenta el daño de sangrado un 3.1% extra\n\n\n\nAlivio presto\nArmonía\n Tu sanación directa aumenta un 10% extra y lanzar tus hechizos de sanación directa te otorga un bonus de un 10% extra a la sanación periódica durante 10 sec. Cada punto de maestría aumenta cada bonus hasta un 1.25% extra\n\n Selecciona una especialización de talentos para activar el bonus del índice de maestría. Consulta tu panel de talentos para más información."}
MultiLanguageSpellData['es'][86471] = {name = "Maestría", additional_info = "[q]Te permite beneficiarte del índice de maestría.\n\nGolpe en el corazón\nEscudo de Sangre\n Cada vez que te sanes con Golpe letal mientras estás en Presencia de sangre, ganas un 50% de la cantidad sanada como escudo de absorción de daño. Cada punto de maestría aumenta el escudo un 6.25% extra\n\n\n\nGolpe de Escarcha\nCorazón congelado\n Aumenta un 16% todo el daño de Escarcha infligido. Cada punto de maestría aumenta el daño de Escarcha un 2.0% extra\n\n\n\nGolpe de la Plaga\nHoja terrorífica\n Aumenta un 20% todo el daño de las Sombras infligido. Cada punto de maestría aumenta el daño de las Sombras un 2.5% extra\n\n Selecciona una especialización de talentos para activar el bonus del índice de maestría. Consulta tu panel de talentos para más información."}
MultiLanguageSpellData['es'][86472] = {name = "Maestría", additional_info = "[q]Te permite beneficiarte del índice de maestría.\n\nIntimidación\nMaestro de bestias\n Aumenta un 13.4% el daño infligido por tus mascotas. Cada punto de maestría aumenta el daño de las mascotas un 1.67% extra\n\n\n\nDisparo de puntería\nCarcaj salvaje\n Otorga un 16.8% de probabilidad de que tus ataques a distancia lancen un disparo a distancia extra. Cada punto de maestría aumenta la probabilidad un 2.1% extra\n\n\n\nDisparo explosivo\nEsencia de la víbora\n Aumenta un 8% todo el daño mágico que infliges. Cada punto de maestría aumenta el daño mágico un 1.0% extra\n\n Selecciona una especialización de talentos para activar el bonus del índice de maestría. Consulta tu panel de talentos para más información."}
MultiLanguageSpellData['es'][86473] = {name = "Maestría", additional_info = "[q]Te permite beneficiarte del índice de maestría.\n\nTromba Arcana\nAdepto de maná\n Aumenta todo el daño con hechizos infligido por ti hasta un 12%, en función de la cantidad de maná que el mago no haya gastado. Cada punto de maestría aumenta el daño que infliges un 1.5% adicional\n\n\n\nPiroexplosión\nQuemadura relámpago\n Aumenta un 22.4% el daño infligido por todos tus efectos de daño de Fuego periódicos. Cada punto de maestría aumenta un 2.8% extra el daño periódico infligido\n\n\n\nInvocar elemental de agua\nAbrasión de Escarcha\n Todos tus hechizos infligen un 20% más de daño contra objetivos congelados. Cada punto de maestría aumenta el daño un 2.5% extra\n\n Selecciona una especialización de talentos para activar el bonus del índice de maestría. Consulta tu panel de talentos para más información."}
MultiLanguageSpellData['es'][86474] = {name = "Maestría", additional_info = "Requiere Paladín\n[q]Te permite beneficiarte del índice de maestría.\n\nChoque Sagrado\nSanación iluminada\n Tus hechizos de sanación directa también colocan un escudo de absorción sobre tu objetivo por un 12% de la cantidad sanada y que dura 15 sec. Cada punto de maestría aumenta la cantidad absorbida un 1.50% extra\n\n\n\nEscudo de vengador\nBaluarte divino\n Aumenta un 18% tu probabilidad de bloquear ataques cuerpo a cuerpo. Cada punto de maestría aumenta la probabilidad de bloqueo un 2.25% extra\n\n\n\nVeredicto del templario\nMano de Luz\n Tu Veredicto del templario, Golpe de cruzado y Tormenta divina infligen un 16.8% de daño extra como daño Sagrado. Cada punto de maestría aumenta el daño un 2.1% extra\n\n Selecciona una especialización de talentos para activar el bonus del índice de maestría. Consulta tu panel de talentos para más información."}
MultiLanguageSpellData['es'][86475] = {name = "Maestría", additional_info = "[q]Te permite beneficiarte del índice de maestría.\n\nPenitencia\nEscudo de Disciplina\n Aumenta un 20% la potencia de todos tus hechizos de absorción de daño. Cada punto de maestría aumenta la potencia de las absorciones un 2.5% extra\n\n\n\nPalabra Sagrada: Condena\nEco de Luz\n Tus hechizos de sanación directa sanan un 10% extra durante 6 sec. Cada punto de maestría proporciona un 1.25% extra de sanación durante 6 sec\n\n\n\nTortura mental\nPoder de Orbes de las Sombras\n Aumenta el daño infligido por tu Orbes de las Sombras un 11.6% extra. Cada punto de maestría aumenta el daño un 1.45% extra\n\n Selecciona una especialización de talentos para activar el bonus del índice de maestría. Consulta tu panel de talentos para más información."}
MultiLanguageSpellData['es'][86476] = {name = "Maestría", additional_info = "[q]Te permite beneficiarte del índice de maestría.\n\nMutilar\nVenenos pujantes\n Aumenta un 28% el daño infligido por tus venenos. Cada punto de maestría aumenta el daño un 3.5% extra\n\n\n\nAluvión de acero\nDaga de guardamano\n Tus ataques con la mano derecha tienen un 16% de probabilidad de que lances un ataque que inflija un daño equivalente al 100% del ataque con la mano derecha. Cada punto de maestría aumenta la probabilidad un 2.00% extra\n\n\n\nPaso de las Sombras\nVerdugo\n Aumenta un 20% el daño infligido por todos tus remates y la eficacia de tu facultad Hacer picadillo. Cada punto de maestría aumenta el daño un 0.1% extra\n\n Selecciona una especialización de talentos para activar el bonus del índice de maestría. Consulta tu panel de talentos para más información."}
MultiLanguageSpellData['es'][86477] = {name = "Maestría", additional_info = "[q]Te permite beneficiarte del índice de maestría.\n\nTormenta de truenos\nSobrecarga elemental\n Otorga un 16% de probabilidad de probabilidad de que se produzca Sobrecarga elemental, lo que provoca que uno de tus lanzamientos de Descarga de relámpagos, Descarga de relámpagos o Ráfaga de lava active un segundo hechizo similar sobre el mismo objetivo sin coste extra que inflige un 75% del daño normal y no genera amenaza. Cada punto de maestría aumenta la probabilidad de una Sobrecarga elemental un 2% extra\n\n\n\nLatigazo de lava\nElementos mejorados\n Aumenta un 20% todo el daño elemental infligido. Cada punto de maestría aumenta el daño un 2.5% extra\n\n\n\nEscudo de tierra\nSanación profunda\n Aumenta la potencia de tus hechizos de sanación directa hasta un 24% en función del nivel de salud actual de tu objetivo (los objetivos con la salud más baja se sanan más). Cada punto de maestría aumenta las sanaciones directas hasta un 3.0%\n\n Selecciona una especialización de talentos para activar el bonus del índice de maestría. Consulta tu panel de talentos para más información."}
MultiLanguageSpellData['es'][86478] = {name = "Maestría", additional_info = "[q]Te permite beneficiarte del índice de maestría.\n\nAflicción inestable\nAflicciones pujantes\n Aumenta un 13% todo el daño de las Sombras periódico que infliges. Cada punto de maestría aumenta el daño de las Sombras periódico un 1.63% extra\n\n\n\nInvocar guardia vil\nMaestro demonólogo\n Aumenta un 18.4% el daño infligido por tus sirvientes demoníacos y el daño que infliges transformado en demonio. Cada punto de maestría aumenta el daño un 2.3% extra\n\n\n\nConflagrar\nApocalipsis ígneo\n Aumenta un 10.8% todo el daño de Fuego infligido. Cada punto de maestría aumenta el daño de Fuego un 1.35% extra\n\n Selecciona una especialización de talentos para activar el bonus del índice de maestría. Consulta tu panel de talentos para más información."}
MultiLanguageSpellData['es'][86479] = {name = "Maestría", additional_info = "[q]Te permite beneficiarte del índice de maestría.\n\nGolpe mortal\nGolpe de oportunidad\n Tu maestría otorga un 17.6% de probabilidad de que tus ataques cuerpo a cuerpo activen de forma instantánea un ataque cuerpo a cuerpo extra que inflige un 100% del daño normal. Cada punto de maestría aumenta esta probabilidad un 2.2%\n\n\n\nSed de sangre\nFuria indomable\n Tu maestría aumenta un 44.8% el beneficio de facultades de que hacen o requieren que te enfurezcas. Cada punto de maestría aumenta un 5.60% los efectos de enfurecer\n\n\n\nEmbate con escudo\nBloqueo crítico\n Tu maestría aumenta un 12% tu probabilidad de bloqueo y un 12% tu probabilidad de bloqueo crítico. Cada punto de maestría aumenta un 1.5% tus probabilidades de bloqueo y un 1.5% tus probabilidades de bloqueo crítico\n\n Selecciona una especialización de talentos para activar el bonus del índice de maestría. Consulta tu panel de talentos para más información."}
