MultiLanguageSpellData['es'][89890] = {name = "[q0]Ídolo Espina Ahumada siniestro", additional_info = "Hechizo de 3 seg 5\n[q]Cuando los elfos nobles entraron en guerra con los trols Amani, los elfos no entendían cómo los encantamientos de armas trol eran más poderosos que los suyos. Entonces robaron la sabiduría ancestral de los taumaturgos trol, incluido el famoso Zanza, y utilizaron ídolos como este para preparar sus propias versiones de los encantamientos trol.\n[q0]Ídolo Espina Ahumada siniestro\nSe liga al recogerlo"}
MultiLanguageSpellData['es'][89891] = {name = "[q0]Presea de cinabrio", additional_info = "Hechizo de 3 seg 5\n[q]Este pequeño símbolo estaba hecho de un mineral rojo volcánico (y tóxico). La inscripción de la parte posterior indica que en su día fue propiedad de Min'loth la Serpiente. Restos de percebes sugieren que la joya ha pasado algo de tiempo bajo el agua.\n[q0]Presea de cinabrio\nSe liga al recogerlo"}
MultiLanguageSpellData['es'][89892] = {name = "Lanzar bomba", additional_info = "Alcance de 15 m\nInstante\n[q]Lanza una bomba a un chorro de aceite cercano para encenderlo."}
MultiLanguageSpellData['es'][89893] = {name = "[q0]Moneda de Eldre'Thalas", additional_info = "Hechizo de 3 seg 5\n[q]Una vez capital de los Altonato, la ciudad de los arcanistas de la reina Azshara degeneró en decadencia y depravación tras el Gran Cataclismo. Ahora la ruina se conoce como La Masacre.\n[q0]Moneda de Eldre'Thalas\nSe liga al recogerlo"}
MultiLanguageSpellData['es'][89894] = {name = "[q0]Guja destrozada", additional_info = "Hechizo de 3 seg 5\n[q]Este es un fragmento de un gran proyectil de tres hojas disparado con armas de asedio de los elfos. Aunque los lanzagujas siguen siendo comunes hoy en día, este fragmento pertenece a un diseño antiguo con ornamentación detallada, incluso para los estándares de los elfos.\n[q0]Guja destrozada\nSe liga al recogerlo"}
MultiLanguageSpellData['es'][89895] = {name = "[q0]Concha de amonites retorcida", additional_info = "Hechizo de 3 seg 5\n[q]Los amonites son un tipo de molusco con concha extinto. La concha podía ser larga como una flecha o retorcida de varias formas diferentes. Aunque este fósil es de un espécimen pequeño, podían llegar a ser bastante grandes.\n[q0]Concha de amonites retorcida\nSe liga al recogerlo"}
MultiLanguageSpellData['es'][89896] = {name = "[q0]Anillo de dragón Verde", additional_info = "Hechizo de 3 seg 5\n[q]Se trata muy posiblemente de una representación de Eranikus, consorte de Ysera. Eranikus se perdió en la corrupción de la Pesadilla Esmeralda y luego fue redimido. En el interior del anillo está la inscripción: \"¡Andu-falah-dor!\".\n[q0]Anillo de dragón Verde\nSe liga al recogerlo"}
