MultiLanguageSpellData['es'][90410] = {name = "[q0]Espada dentada de Tunadil el Redentor", additional_info = "Hechizo de 3 seg 5\n[q]Esta hoja se rompió cuando el paladín cayó sobre ella mientras luchaba con la terrible vermis Kaldrigos.\n[q0]Espada dentada de Tunadil el Redentor\nSe liga al recogerlo"}
MultiLanguageSpellData['es'][90411] = {name = "[q0]Aldaba soberbia", additional_info = "Hechizo de 3 seg 5\n[q]No puedes evitar imaginar qué tipo de residencia o negocio adornó en su día este artefacto. Este, eh... llamador tiene la forma de una enana pechugona con una sonrisa sin varios dientes y que lleva alegre muchas pintas.\n[q0]Aldaba soberbia\nSe liga al recogerlo"}
MultiLanguageSpellData['es'][90412] = {name = "[q0]Talón de bota con ornamentos", additional_info = "Hechizo de 3 seg 5\n[q]La atención al detalle en esta simple tapa de bota sugiere que el calzado original podría haber sido mágico. La ornamentación es muy abstracta, pero pueden distinguirse pequeños animales del bosque (ardillas, un ciervo, puede que una mofeta) ocultos en la ornamentación y en los nudos estilizados.\n[q0]Talón de bota con ornamentos\nSe liga al recogerlo"}
MultiLanguageSpellData['es'][90413] = {name = "[q0]Orinal dorado", additional_info = "Hechizo de 3 seg 5\n[q]Aparentemente los ricos y famosos hacen todo con estilo. Esta pieza está decorada con un pez saltarín y un arroyo corriente.\n[q0]Orinal dorado\nSe liga al recogerlo"}
