MultiLanguageSpellData['es'][90415] = {name = "[q0]Yelmo alado de Coramartillo", additional_info = "Hechizo de 3 seg 5\n[q]Viendo el tamaño de este yelmo, el señor feudal Coramartillo de los Hierro Negro debe haber sido enorme o puede que solo enormemente gordo.\n[q0]Yelmo alado de Coramartillo\nSe liga al recogerlo"}
