MultiLanguageSpellData['es'][90419] = {name = "[q0]Escudo petrificado Ferroestrella", additional_info = "Hechizo de 3 seg 5\n[q]De acuerdo con la leyenda, el señor feudal Ferroestrella de los enanos Hierro Negro talló este escudo a partir de un árbol elfo de la noche y lo encantó para volverlo tan duro como la piedra.\n[q0]Escudo petrificado Ferroestrella\nSe liga al recogerlo"}
MultiLanguageSpellData['es'][90420] = {name = "[q0]Maceta con forma de calavera", additional_info = "Hechizo de 3 seg 5\n[q]Los trols de bosque tienen una gran afinidad con la flora. Los propios cuerpos de los trols pueden albergar vegetación simple, como musgo o algas, lo que les da su color verde característico.\n[q0]Maceta con forma de calavera\nSe liga al recogerlo"}
MultiLanguageSpellData['es'][90421] = {name = "[q0]Pulsera de jade y monedas", additional_info = "Hechizo de 3 seg 5\n[q]Este brazalete se hizo uniendo monedas trol y pedazos de jade pulidos con una cadena de plata. Como los trols solían preferir el oro en su joyería, es posible que la plata se capturase de otra raza, lo que haría que esta pieza tenga un origen más reciente. Las monedas son poco comunes y representan los rostros maliciosos de una serie de damas trol.\n[q0]Pulsera de jade y monedas\nSe liga al recogerlo"}
MultiLanguageSpellData['es'][90422] = {name = "Rajadura colosal", additional_info = nil}
MultiLanguageSpellData['es'][90423] = {name = "[q0]Figurilla de Gahz'rilla", additional_info = "Hechizo de 3 seg 5\n[q]Los trols de las arenas invocaron esta gran hidra blanca de una charca sagrada de Zul'Farrak y, entonces, procedieron a adorarla como su dios. Las escamas de Gahz'rilla están electrificadas e incluso esta pequeña figura parece vivir con la energía. En Zul'Farrak, la hidra legendaria es un motivo común en la arquitectura y la ornamentación.\n[q0]Figurilla de Gahz'rilla\nSe liga al recogerlo"}
