MultiLanguageSpellData['es'][90429] = {name = "[q0]Cetro de Atal'ai", additional_info = "Hechizo de 3 seg 5\n[q]'Atal'ai' significa 'devotos' en Zandali y este grupo de trols perturbados eran devotos del Dios de la Sangre Hakkar, un ser de extrema malevolencia al que se ha derrotado varias veces, pero que siempre consigue volver de la muerte. Este cetro está decorado con un motivo malvado, posiblemente una conexión con Hir'eekm, el dios murciélago primigenio.\n[q0]Cetro de Atal'ai\nSe liga al recogerlo"}
