MultiLanguageSpellData['es'][90432] = {name = "[q0]Diente de demosaurio", additional_info = "Hechizo de 3 seg 5\n[q]Los demosaurios son uno de los predadores más grandes que nunca hayan caminado por la faz de Azeroth. Aunque la mayoría se extinguieron hace millones de años, algunos resisten en ubicaciones aisladas hoy en día. Hay muchas especulaciones sobre el propósito de sus antebrazos deteriorados. Entre las teorías están la de que les ayudó a ponerse en pie o la de que era para titilar a las hembras. Es necesaria más observación.\n[q0]Diente de demosaurio\nSe liga al recogerlo"}
MultiLanguageSpellData['es'][90433] = {name = "[q0]Insecto en ámbar", additional_info = "Hechizo de 3 seg 5\n[q]El ámbar es resina de árbol petrificada. Uno de los propósitos de la resina es defender al árbol de los insectos que lo atacan, así que trozos de ámbar poco frecuentes pueden contener insectos conservados en su interior.\n[q0]Insecto en ámbar\nSe liga al recogerlo"}
