MultiLanguageSpellData['es'][90451] = {name = "[q0]Ánfora kaldorei", additional_info = "Hechizo de 3 seg 5\n[q]Esta vasija esbelta con dos asas curvas se utilizó para mezclar o almacenar vino darnassiano. Incluso pasado todo este tiempo, aún se puede detectar un débil olor a jengibre de los residuos secos del fondo de la vasija.\n[q0]Ánfora kaldorei\nSe liga al recogerlo"}
MultiLanguageSpellData['es'][90452] = {name = "[q0]Mandíbulas de tiburón antiguo", additional_info = "Hechizo de 3 seg 5\n[q]Los tiburones no tienen huesos de verdad, solo cartílago. Como sus hábitos alimenticios incluyen morder cosas con mucha fuerza, la pérdida de dientes es común. Por ello, los tiburones tienen varias filas de dientes que reemplazan constantemente durante su vida.\n[q0]Mandíbulas de tiburón antiguo\nSe liga al recogerlo"}
