MultiLanguageSpellData['es'][90458] = {name = "[q0]Caja de música delicada", additional_info = "Hechizo de 3 seg 5\n[q]Se trata de una caja de sándalo con un pequeño elfo mecánico y un sable de la noche en el interior. Aunque el sinuoso mecanismo ya no funciona, puedes imaginar cómo los dos bailaban juntos mientras sonaba la música. Grabado en el fondo: \"A mi querida Theleste\".\n[q0]Caja de música delicada\nSe liga al recogerlo"}
