MultiLanguageSpellData['es'][90464] = {name = "[q3]Espejo de almas de Altonato", additional_info = "Hechizo de 3 seg 15\n[q]Antes del Gran Cataclismo, los Altonato eran conocidos entre los elfos de la noche por su arrogancia, avaricia y ropajes extravagantes. Se llegó a decir que para los Altonato nada era tan agradable a la vista como ellos mismos. Estos espejos se crearon para que las elfas pudiesen ver sus coloridos atuendos en tres dimensiones, aunque el reflejo exageraba a menudo la vista ya depravada del que miraba.\n[q3]Espejo de almas de Altonato\nSe liga al recogerlo\nJuguete\n[q2]Uso: Mira al espejo... (10 Min Reutilización)"}
