MultiLanguageSpellData['es'][90507] = {name = "Comemuerte", additional_info = "Instante\n[q]Cada vez que consigues una runa de muerte, también obtienes un 1% de poder de ataque aumentado durante 30 sec. Se acumula hasta 3 veces."}
MultiLanguageSpellData['es'][90508] = {name = "Burning Steppes Guardian Aura (H)", additional_info = nil}
MultiLanguageSpellData['es'][90509] = {name = "[q0]Cetro de Charlga Filonavaja", additional_info = "Hechizo de 3 seg 5\n[q]Aunque estos fragmentos de artefactos se encontraron mezclados con esos enanos, está claro que este cetro no está fabricado por enanos, sino por jabaespines. De hecho, una vez lo empuñó la misma Charlga Filonavaja. Puede que los enanos tomasen posesión de él cuando los héroes intentaron conquistar Horado Rajacieno.\n[q0]Cetro de Charlga Filonavaja\nSe liga al recogerlo"}
MultiLanguageSpellData['es'][90510] = {name = "Quest Invisibility 25", additional_info = nil}
MultiLanguageSpellData['es'][90511] = {name = "Invisibility Detection Quest 25", additional_info = nil}
MultiLanguageSpellData['es'][90518] = {name = "[q0]Cadena de mitril de Forjainquina", additional_info = "Hechizo de 3 seg 5\n[q]La familia Forjainquina tiene un largo linaje en la historia de los enanos Hierro Negro. Esta es una cadena que llevaba el señor feudal Forjainquina, el ancestro del General Forjainquina, que aún dirige a los ejércitos Hierro Negro de las Profundidades de Roca Negra.\n[q0]Cadena de mitril de Forjainquina\nSe liga al recogerlo"}
MultiLanguageSpellData['es'][90519] = {name = "[q0]Bastón de calaveras de Forjatiniebla", additional_info = "Hechizo de 3 seg 5\n[q]La familia Forjatiniebla supone una gran lacra en la historia de los Hierro Negro. El férreo señor feudal Forjatiniebla fue en todos los sentidos un cruel déspota que torturó y mató a muchos de los suyos. Aunque la creencia general es que fue un brujo, algunos defienden el rumor de que fue uno de los primeros enanos chamanes.\n[q0]Bastón de calaveras de Forjatiniebla\nSe liga al recogerlo"}
MultiLanguageSpellData['es'][90520] = {name = "Sobrecarga Arcana", additional_info = nil}
MultiLanguageSpellData['es'][90521] = {name = "[q3]Gnomo de relojería", additional_info = "Hechizo de 3 seg 15\n[q]Los mecagnomos fueron creados por los titanes, aparentemente como sirvientes y cuidadores, parecido a los terráneos. Es probable que este mecagnomo sufriese daños porque ya no está centrado en sus tareas originales y parece contento por seguirte.\n[q3]Gnomo de relojería\nSe liga al recogerlo\n[q2]Uso: Te enseña a invocar este compañero.\n[q2]Haz clic con el botón derecho para invocar y retirar a tu gnomo de relojería."}
MultiLanguageSpellData['es'][90522] = {name = "Caparazón acuático", additional_info = "Alcance de 40 m\nHechizo de 2 seg\n[q]Absorbe 50000 p. de daño; si el Caparazón acuático se rompe, explota e inflige 48750 to 51250 p. de daño de Escarcha a los enemigos en un radio de 8 m."}
