MultiLanguageSpellData['es'][90553] = {name = "[q3]Cáliz de los reyes de la montaña", additional_info = "Hechizo de 3 seg 15\n[q]\"Además de las muchas joyas que lo adornan, este cáliz está virtualmente cubierto de runas para celebrar una antigua ceremonia de ascensión para los reyes enanos. Beber de este cáliz era, sin duda, parte de ella, pero las runas describen una \"danza de espadas\" llevada a cabo por enanas guerreras. Este acto, en parte ritual y en parte representación de batalla, evolucionó aparentemente a partir de duelos sangrientos de épocas menos sofisticadas de la historia de los enanos\".\n[q3]Cáliz de los reyes de la montaña\nSe liga al recogerlo\nJuguete\n[q2]Uso: Presencia una danza de espadas histórica. (10 Min Reutilización)"}
