MultiLanguageSpellData['es'][90581] = {name = "[q0]Cuchillo de sacrificio Drakkari", additional_info = "Hechizo de 3 seg 5\n[q]La tribu de los Drakkari fue desplazada al norte por otros trols y finalmente se asentó en Rasganorte, donde sobrevivieron a los duros elementos para establecer su propia nación. La llegada del Rey Exánime fue una gran amenaza para los Drakkari. Uno de sus intentos menos sensatos de matar al Rey Exánime fue sacrificar a sus propios dioses animales: la serpiente, el leopardo de las nieves, el oso, la serpiente alada, el mamut y el rinoceronte.\n[q0]Cuchillo de sacrificio Drakkari\nSe liga al recogerlo"}
