MultiLanguageSpellData['es'][90608] = {name = "[q4]Zin'rokh, Destructora de Mundos", additional_info = "Hechizo de 3 seg 15\n[q]De acuerdo con tus investigaciones, esta gran arma fue uno de los muchos tesoros de Hakkar el Cazador de Almas de Zul'Gurub. Hakkar fue derrotado hace años y su espada pasó por las manos de muchos poderosos guerreros y paladines antes de, aparentemente, quedar hendida. Es destacable que hayas podido reforjarla, pero también es inquietante: si la Destructora de Mundos ha vuelto puede que el Cazador de almas no ande muy lejos.\n[q4]Zin'rokh, Destructora de Mundos\nSe liga a la cuenta\nÚnicoDos manos Espada\n1,894 - 2,842 Daño Velocidad 3.80\n(623.16 daño por segundo)\n+341 fuerza\n+512 aguante\nDurabilidad 120 / 120\nNecesitas ser de nivel 85\n[q2]Equipar: Mejora el índice de golpe crítico en 238 p.\n[q2]Equipar: Mejora el índice de golpe en 216 p."}
MultiLanguageSpellData['es'][90609] = {name = "[q0]Cuerda con perlas rosas pequeñas", additional_info = "Hechizo de 3 seg 5\n[q]Aunque por separado esas perlas no sean particularmente grandes, es destacable como cuarenta y dos de ellas parecen ser prácticamente idénticas. En lugar del blanco opalescente o incluso el negro extraño de las típicas perlas de las ostras, estas son de un color rosado. Una concha de vieira completa la pieza.\n[q0]Cuerda con perlas rosas pequeñas\nSe liga al recogerlo"}
MultiLanguageSpellData['es'][90610] = {name = "[q0]Cofre de animales de cristal pequeños", additional_info = "Hechizo de 3 seg 5\n[q]Increíblemente, has conseguido reunir una colección entera de esos animales de cristal élficos en el envase en que estaban almacenados originalmente. Aunque algunos de los animales estén rotos y agrietados, está claro que la cabeza del venado se ha cortado a propósito. La letra \"T\" está tallada en la parte inferior del cofre.\n[q0]Cofre de animales de cristal pequeños\nSe liga al recogerlo"}
MultiLanguageSpellData['es'][90611] = {name = "[q0]Vial de cristal rajado", additional_info = "Hechizo de 3 seg 5\n[q]Una nota en vitela rica va atada a la botella. \"Estimado P, ahora que sé que nunca podremos estar juntos, decido beber este trago de veneno de araña. Si te llega esta nota, tengo la esperanza de que hagas lo mismo. Que Elune cuide de nuestras almas.\"\n[q0]Vial de cristal rajado\nSe liga al recogerlo"}
MultiLanguageSpellData['es'][90612] = {name = "[q0]Cetro de Xavius", additional_info = "Hechizo de 3 seg 5\n[q]Xavius fue responsable de muchos de los males que cayeron sobre los elfos de la noche durante la Guerra de los Ancestros. Malfurion Tempestira fue al final capaz de frustrar los planes de Xavius y lo destruyó en el proceso. Posteriormente, Sargeras torturó el espíritu de Xavius durante un tiempo hasta que finalmente le otorgó la forma retorcida del primer sátiro.\n[q0]Cetro de Xavius\nSe liga al recogerlo"}
MultiLanguageSpellData['es'][90614] = {name = "[q3]Campanillas de viento kaldorei", additional_info = "Hechizo de 3 seg 15\n[q]Estas campanillas están compuestas de una serie de tubos de bronce muy decorados de varias longitudes, conectados a un tubo de bronce diseñado para que pareciese una viña. Este artefacto es mágico y las campanillas parecen tocar música por voluntad propia, incluso cuando no hay viento.\n[q3]Campanillas de viento kaldorei\nSe liga al recogerlo\nJuguete\n[q2]Uso: Levanta las campanillas al viento para ver cómo está el tiempo. (1 Min Reutilización)"}
MultiLanguageSpellData['es'][90615] = {name = "Fourth and Goal: Character Earthquake", additional_info = nil}
MultiLanguageSpellData['es'][90616] = {name = "[q4]Vestido de la reina Azshara", additional_info = "Hechizo de 3 seg 15\n[q]Que Azshara era la más bella de las elfas de la noche se considera prácticamente como un hecho. Por desgracia, su ojo para la belleza parece haber sido tan limitado como el de muchos de sus hermanos, al menos juzgando por los colores chillones de esta toga. \"Solo ha habido y solo habrá... una Azshara\".\n[q4]Vestido de la reina Azshara\nSe liga a la cuenta\nPecho Tela\n258 armadura\n+27 aguante\n+41 intelecto\nDurabilidad 165 / 165\nNecesitas ser de nivel 51\n[q2]Equipar: Mejora el índice de celeridad en 23 p.\n[q]\"Los rumores del poco sentido del gusto de los Altonato parecen ser ciertos.\""}
MultiLanguageSpellData['es'][90617] = {name = "[q0]Brazo de raptor con plumas", additional_info = "Hechizo de 3 seg 5\n[q]En la Liga de Expedicionarios, algunos piensan que los pájaros descienden de los dinosaurios, como este raptor. Las plumas sugieren algún tipo de eslabón perdido entre dos tipos de animales diferentes. Como alternativa, podría ser simplemente uno de tantos monstruos extraños que invaden Azeroth.\n[q0]Brazo de raptor con plumas\nSe liga al recogerlo"}
MultiLanguageSpellData['es'][90618] = {name = "[q0]Pez antiguo sañoso", additional_info = "Hechizo de 3 seg 5\n[q]El esqueleto del pez está protegido por pesadas placas de hueso y las mandíbulas están alineadas con cientos de dientes como agujas. Hay quien cree que los océanos cubrieron una vez todos los continentes, lo que permite encontrar fósiles de peces a cientos de kilómetros de la costa.\n[q0]Pez antiguo sañoso\nSe liga al recogerlo"}
MultiLanguageSpellData['es'][90619] = {name = "[q4]Raptor fosilizado", additional_info = "Hechizo de 3 seg 15\n[q]Cuando acabaste de montar este esqueleto utilizando algo de magia fantasmal, la criatura volvió a la vida.\n[q4]Raptor fosilizado\nSe liga al recogerlo\nMontura\nNecesitas ser de nivel 40\nRequiereOficial jinete\n[q2]Uso: Te enseña a invocar esta montura.\n[q2]Invoca y retira a un raptor fosilizado que se puede montar."}
