MultiLanguageSpellData['es'][90622] = {name = "[q0]Escorpión de bronce diminuto", additional_info = "Hechizo de 3 seg 5\n[q]Aparentemente este fue una vez un escorpión vivo que se bañó en bronce para conservarlo. Un garabato orco reza en la parte inferior: \"El cabecilla se ríe de tus patéticos intentos de asesinato\".\n[q0]Escorpión de bronce diminuto\nSe liga al recogerlo"}
