MultiLanguageSpellData['es'][90832] = {name = "[q0]Baldosa de arcilla con vidrio", additional_info = "Hechizo de 3 seg 5\n[q]En otro tiempo debió de haber muchas de estas baldosas decorando las paredes o el suelo de una fortaleza o un camarote. La baldosa representa animales en rebaño en un campo de brillo verde y amarillo, muy semejante a cómo es Nagrand hoy en día. El borde es de cuadros blancos y negros.\n[q0]Baldosa de arcilla con vidrio\nSe liga al recogerlo"}
