MultiLanguageSpellData['es'][90843] = {name = "[q4]Ornato del primer chamán", additional_info = "Hechizo de 3 seg 15\n[q]El origen del chamanismo entre los orcos sigue siendo un misterio. El chamanismo se menciona desde los primeros registros de historia orca. Este simple tocado parece muy antiguo en el tiempo. Su creador y el que lo llevaba originalmente se han perdido en la historia.\n[q4]Ornato del primer chamán\nSe liga a la cuenta\nCabeza Malla\n720 armadura\n+39 agilidad\n+21 aguante\n\n[q0]Ranura roja\n[q0]Ranura azul\n[q0]Ranura amarilla\n[q0]Bono de ranura: +6 aguante\n\nDurabilidad 100 / 100\nNecesitas ser de nivel 61\n[q2]Equipar: Mejora el índice de golpe crítico en 22 p.\n[q2]Equipar: Mejora el índice de golpe en 22 p.\n[q2]Uso: Te permite ver a mucha distancia. (1 Min Reutilización)"}
