MultiLanguageSpellData['es'][90968] = {name = "[q0]Vaina de espada barroca", additional_info = "Hechizo de 3 seg 5\n[q]Esta vaina de espada tiene una ornamentación casi desagradable. En toda la superficie visible se ha tallado, dorado o se han hecho inscripciones. Es probable que el arma que una vez llevó envainada fuese de una naturaleza muy mágica o ceremonial.\n[q0]Vaina de espada barroca\nSe liga al recogerlo"}
