MultiLanguageSpellData['es'][90974] = {name = "[q0]Candelabro de cristal refinado", additional_info = "Hechizo de 3 seg 5\n[q]Esta pieza tuvo un día una docena de velas. Está cubierta de cristales azules y violetas conectados por finas cadenas y ornamentos para decorar. Las iniciales del artesano están grabadas en el fondo: \"V. T.\".\n[q0]Candelabro de cristal refinado\nSe liga al recogerlo"}
MultiLanguageSpellData['es'][90975] = {name = "[q0]Retrato dignificado", additional_info = "Hechizo de 3 seg 5\n[q]Se trata de una pintura al óleo muy seria de un caballero draenei muy serio. Aunque la obra es en general halagadora, puedes notar que al artista no le caía muy bien el modelo, ya que en la parte inferior del cuadro puedes ver cómo pintó al caballero sin pantalones.\n[q0]Retrato dignificado\nSe liga al recogerlo"}
