MultiLanguageSpellData['es'][90980] = {name = "Rajar", additional_info = "Alcance de ataques cuerpo a cuerpo\nSiguiente cuerpo a cuerpo\n[q]Inflige un 150% de daño cuerpo a cuerpo normal a un enemigo y a sus aliados cercanos. Afecta hasta a 3 objetivos."}
MultiLanguageSpellData['es'][90983] = {name = "[q3]Llegada de los Naaru", additional_info = "Hechizo de 3 seg 15\n[q]El cristal parece ser un dispositivo de grabación mágico de algún tipo. El mensaje que reproduce está en un idioma que no puedes descifrar del todo, pero deduces que es o bien una grabación o una recreación del primer encuentro de los eredar y los naaru.\n[q3]Llegada de los Naaru\nSe liga al recogerlo\nJuguete\n[q2]Uso: Presencia una grabación de la llegada de los Naaru. (3 Min Reutilización)"}
MultiLanguageSpellData['es'][90984] = {name = "[q3]La última reliquia de Argus", additional_info = "Hechizo de 3 seg 15\n[q]Antes de vivir en Azeroth o en Draenor, los draenei, que aún eran eredar en aquel momento, vivían en Argus. Cuando Sargeras se dio cuenta de la existencia de Argus, el profeta Velen huyó con algunos miembros de su pueblo, que hoy conocemos como los draenei. Los demás eredar fueron absorbidos por la Legión Ardiente. Este cristal simple se extrajo de Argus cuando Velen huyó. La inscripción del fondo dice 'Añoro a Mac'Aree.'\n[q3]La última reliquia de Argus\nSe liga al recogerlo\n[q2]Uso: Te teletransporta exactamente adonde quieres ir... si no eres muy exigente. (12 H Reutilización)\n[q]\"Una de las pocas cosas que consiguieron llevarse los draenei en su vuelo desde Argus.\""}
