MultiLanguageSpellData['es'][90987] = {name = "[q0]Fusta de elekk chapada", additional_info = "Hechizo de 3 seg 5\n[q]Los elekk son criaturas nativas de Draenor, concretamente de la zona de Nagrand, parecidas a los mamuts. Los draenei domesticaron a los elekk para usarlos como monturas. Esta fusta es un palo largo con punta que se usa para motivar a los elekk hoscos que no han completado su entrenamiento.\n[q0]Fusta de elekk chapada\nSe liga al recogerlo"}
MultiLanguageSpellData['es'][90988] = {name = "[q0]Llave de la arqueta intrincada", additional_info = "Hechizo de 3 seg 5\n[q]Aunque la tecnología vrykul está en general un poco por detrás de la de la Horda o la Alianza, el detalle del diseño de esta simple llave es impresionante. En la cultura vrykul, es la mujer de la casa la que guarda todas las llaves y a menudo las exhibe para mostrar su estatus. \"No abre el cofre del clérigo oscuro Salem\".\n[q0]Llave de la arqueta intrincada\nSe liga al recogerlo"}
