MultiLanguageSpellData['es'][90997] = {name = "[q4]Hacha barbada Nafsavar", additional_info = "Hechizo de 3 seg 15\n[q]Muchas de las hachas forjadas por los vrykul presentan un estilo inusual: el borde inferior de la hoja del hacha sobrepasa la extensión del ancho de la parte inferior. Este estilo aumenta la zona de corte a la vez que minimiza el peso; se puede utilizar tanto en armas como herramientas. Algunas hachas enanas presentan una construcción similar.\n[q4]Hacha barbada Nafsavar\nSe liga a la cuenta\nUna mano Hacha\n312 - 580 Daño Velocidad 2.60\n(171.54 daño por segundo)\n+36 agilidad\n+87 aguante\nDurabilidad 105 / 105\nNecesitas ser de nivel 71\n[q2]Equipar: Mejora el índice de golpe crítico en 37 p.\n[q2]Equipar: Mejora el índice de golpe en 24 p."}
