MultiLanguageSpellData['es'][91211] = {name = "[q0]Banderín garabateado de visir", additional_info = "Hechizo de 3 seg 5\n[q]Este objeto extraño parece ser un trozo de un pergamino de proporciones inmensas. El material es un cruce entre papiro y cuero está cubierto de diagramas y escritura nerubiana en rojo y carmesí. \"Unhhh-tikk-a-shisss. Kka shir. Na-l bkah a-shisss. Kreesh kik ik ta. Sohk-a tik hiss a-k-k-k\".\n[q0]Banderín garabateado de visir\nSe liga al recogerlo"}
