MultiLanguageSpellData['es'][91215] = {name = "[q4]Caja de puzles de Yogg-Saron", additional_info = "Hechizo de 3 seg 15\n[q]Esta pequeña caja tiene muchos paneles que se cambian, bisagras que se mueven y cierres escondidos. Pero no importa cómo los manipules, parece imposible abrir la caja para descubrir los contenidos de su interior. También es difícil simplemente intentarlo, porque el artefacto oscuro no deja de susurrarte: \"FUE culpa tuya. FUE culpa tuya. FUE culpa tuya. FUE culpa tuya\".\n[q4]Caja de puzles de Yogg-Saron\nSe liga al recogerlo\nJuguete\n[q2]Uso: Intenta en vano abrir la caja de puzles. (1 Min Reutilización)\n[q]\"Casi imposible de abrir.\""}
