MultiLanguageSpellData['es'][91221] = {name = "[q0]Mazo de guerra de Ojoardiente", additional_info = "Hechizo de 3 seg 5\n[q]El férreo señor feudal Ojoardiente deslumbraba en la batalla. Se sabe que llevaba un par de grandes martillos de guerra. Has vuelto a montar uno, desde hace mucho sin magia. Eso significa que puede que el otro aún esté por ahí en alguna parte y es posible que siga siendo un arma potente.\n[q0]Mazo de guerra de Ojoardiente\nSe liga al recogerlo"}
