MultiLanguageSpellData['es'][91223] = {name = "[q0]Guanteletes con pinchos de Yunque Colérico", additional_info = "Hechizo de 3 seg 5\n[q]Yunque Colérico fue uno de los reyes más poderosos de las Profundidades de Roca negra. Su insignia del yunque en llamas aún puede verse hoy en día en tabardos y escudos debajo de Roca Negra. Aunque ya no vive para dirigir el ejército Hierro Negro, muchos de los soldados aún llevan su nombre.\n[q0]Guanteletes con pinchos de Yunque Colérico\nSe liga al recogerlo"}
MultiLanguageSpellData['es'][91224] = {name = "[q0]Palabra de la emperatriz Zoe", additional_info = "Hechizo de 3 seg 5\n[q]La Palabra y el Juramento de la emperatriz Zoe fueron en su día un par de poderosos anillos mágicos. El anillo que has recuperado fue la Palabra, que por desgracia perdió sus propiedades mágicas al ser destrozado. El Juramento está perdido pero puede que haya resistido. La propia emperadora fue una gobernante Hierro Negro poco conocida. Muchos enanos perdieron la vida por su obsesión con los dragones al intentar robar sus huevos o sus crías.\n[q0]Palabra de la emperatriz Zoe\nSe liga al recogerlo"}
MultiLanguageSpellData['es'][91225] = {name = "[q0]Cetro de Barbabronce", additional_info = "Hechizo de 3 seg 5\n[q]Barbabronce se refiere tanto a un clan de enanos como a la familia que los gobierna. Los reyes de El Trono han pasado varios cetros durante su gobierno. Por tradición, el rey deja que alguno de sus principales consejeros o aliados lleve el cetro un solo día. Eran días duros para los cetros, que veían el interior de tabernas, caían de montañas, se usaban para golpear a troggs y ese tipo de cosas.\n[q0]Cetro de Barbabronce\nSe liga al recogerlo"}
MultiLanguageSpellData['es'][91226] = {name = "[q3]La hija del tabernero", additional_info = "Hechizo de 3 seg 15\n[q]Según la leyenda, Bryher Cuidapiedra dirigía una taberna exitosa cerca de Loch Modan. Su hija, Keelin, viajó lejos de su hogar y acabó consiguiendo el tipo de reputación que avergonzaba a su padre. Bryher llegó a un acuerdo con un gnomo brujo para que mantuviese a su hija cerca de casa. El brujo convirtió a Keelin en piedra de hogar, para que siempre regresase a la posada.\n[q3]La hija del tabernero\nSe liga al recogerlo\nÚnico\nJuguete\n[q2]Uso: Te devuelve a <Hearthstone Location>. Habla con un tabernero en otro sitio para convertirlo en tu nuevo hogar. (30 Min Reutilización)"}
MultiLanguageSpellData['es'][91227] = {name = "[q4]Bastón de señor feudal hechicero Thaurissan", additional_info = "Hechizo de 3 seg 15\n[q]El señor feudal hechicero Thaurissan fue el líder de los enanos Hierro Negro durante La guerra de los Tres Martillos. Cuando perdió Forjaz a manos del clan Barbabronce, Thaurissan se retiró a las Montañas Crestagrana y fundó una ciudad en su nombre. En un intento desesperado por derrotar a sus enemigos, Thaurissan invocó accidentalmente al semidiós Ragnaros, con el resultado de la muerte inmediata del señor feudal hechicero y la formación del pico volcánico de la Montaña Roca Negra.\n[q4]Bastón de señor feudal hechicero Thaurissan\nSe liga a la cuenta\nDos manos Bastón\n1,047 - 1,571 Daño Velocidad 2.10\n(623.33 daño por segundo)\n+512 aguante\n+341 intelecto\nDurabilidad 120 / 120\nNecesitas ser de nivel 85\n[q2]Equipar: Mejora el índice de golpe crítico en 228 p.\n[q2]Equipar: Mejora el índice de celeridad en 228 p.\n[q2]Equipar: Aumenta el poder con hechizos 1.955 p."}
