MultiLanguageSpellData['es'][91757] = {name = "[q4]Muñeca favorita de Tyrande", additional_info = "Hechizo de 3 seg 15\n[q]Tyrande Susurravientos es la suma sacerdotisa de Elune y con su reciente matrimonio ya no es la única gobernante de los elfos de la noche. Creció en la antigua ciudad de Suramar, lejos del primer Pozo de la Eternidad, cerca de los hermanos Malfurion e Illidan Tempestira. La infancia idílica de Tyrande demostró ser opuesta al dolor y el conflicto que tuvo que soportar posteriormente en su vida.\n[q4]Muñeca favorita de Tyrande\nSe liga a la cuenta\nÚnico-EquipadoAbalorio\n+321 intelecto\nNecesitas ser de nivel 85\n[q2]Equipar: Recupera un 20% del coste del maná base que gastas en hechizos y lo almacena dentro de la muñeca para liberarlo más tarde. Se puede almacenar hasta un máximo de 4200 p. de maná.\n[q2]Uso: Libera todo el maná almacenado en la muñeca, lo que provoca que obtengas todo ese maná y todos los enemigos en un radio de 15 m reciben 1 p. de daño Arcano por cada punto de maná liberado. (1 Min Reutilización)"}
