MultiLanguageSpellData['es'][91761] = {name = "[q4]Huesos de transformación", additional_info = "Hechizo de 3 seg 15\n[q]Cuando implosionó el primer Pozo de la eternidad, hundió el centro de la cultura kaldorei al fondo del mar. Para escapar a una cierta fatalidad, la reina Azshara hizo un pacto con un poder superior, posiblemente un dios antiguo o un elemental. Como resultado, una maldición bajó sobre los Altonato supervivientes, que se transformaron en criaturas retorcidas semejantes a las serpientes ahora conocidos como los nagas.\n[q4]Huesos de transformación\nSe liga al recogerlo\nJuguete\n[q2]Uso: Aguanta la transformación durante 20 sec. (10 Min Reutilización)"}
MultiLanguageSpellData['es'][91762] = {name = "[q0]Bejuquillo de los cien magos", additional_info = "Hechizo de 3 seg 5\n[q]Durante las Guerras Trols, los trols Amani estuvieron a punto de derrotar a los elfos de Quel'Thalas. Con la desesperación, los elfos enseñaron a los humanos de Arathor los caminos de la magia Arcana. Solo enseñaron a un centenar de humanos, el mínimo justo necesario para derrotar a los trols. Los humanos demostraron ser taumaturgos toscos pero tenían una afinidad natural con la magia.\n[q0]Bejuquillo de los cien magos\nSe liga al recogerlo"}
