MultiLanguageSpellData['es'][91766] = {name = "[q0]Tubo de pergamino de plata", additional_info = "Hechizo de 3 seg 5\n[q]Aunque este tubo de pergamino elfo está decorado con mucha ornamentación, lo que más interés tiene es el mensaje de su interior, que está escrito en darnassiano: \"Pyramond, en ninguna circunstancia tienes derecho a pasar tiempo junto a esa pelandrusca de taberna. Tu madre y yo lo prohibimos. Está muy por debajo de ti\".\n[q0]Tubo de pergamino de plata\nSe liga al recogerlo"}
