MultiLanguageSpellData['es'][91769] = {name = "[q0]Media luna umbría", additional_info = "Hechizo de 3 seg 5\n[q]Esta es una hoja circular creada por vigías elfos de la noche. Este tipo de arma fue famosa por llevarla Maiev Cantosombrío, pero aún se puede ver hoy entre elfos de la noche como los vigías de las cavernas del Túmulo del Monte Hyjal. Es probable que este arma que has recuperado fuese mágica antes de quedar rota en tantos fragmentos.\n[q0]Media luna umbría\nSe liga al recogerlo"}
