MultiLanguageSpellData['es'][91773] = {name = "[q4]Amuleto de fuego fatuo", additional_info = "Hechizo de 3 seg 15\n[q]Los fuegos fatuos son espíritus naturales y se creía que eran elfos de la noche muertos. Su existencia está muy ligada a su bosque de origen y a los elfos de la noche en general, por lo que realizan actividades tan beneficiosas como la construcción, la reparación y la defensa de comunidades de elfos. Muchos fuegos fatuos sacrificaron su vida para derrotar a Archimonde en la Tercera Guerra, así que hoy en día hay menos fuegos fatuos de los que solía haber.\n[q4]Amuleto de fuego fatuo\nSe liga al recogerlo\nJuguete\n[q2]Uso: Adoptas forma de fuego fatuo durante 20 sec. (10 Min Reutilización)"}
