MultiLanguageSpellData['es'][91775] = {name = "[q0]Castillo de arena", additional_info = "Hechizo de 3 seg 5\n[q]Se trata de una pequeña fortaleza cuadrada de arena. Las torres cuadradas y los motivos solares sugieren que se trata de arquitectura tol'vir, pero no has visto este plano exacto de suelo en ningún lugar de Uldum. El objeto está claramente hecho de arena, no arenisca, por lo que no estás seguro de qué lo sostiene.\n[q0]Castillo de arena\nSe liga al recogerlo"}
