MultiLanguageSpellData['es'][91779] = {name = "[q0]Estatua de gato con ojos de esmeralda", additional_info = "Hechizo de 3 seg 5\n[q]Este pequeño gato de cerámica muestra una expresión y una pose realistas. En el lado inferior tiene grabado: \"En memoria de Chalyx, amada mascota del emperador Ninjter\".\n[q0]Estatua de gato con ojos de esmeralda\nSe liga al recogerlo"}
MultiLanguageSpellData['es'][91780] = {name = "[q0]Collar de escarabajo de esteatita", additional_info = "Hechizo de 3 seg 5\n[q]'Presentado al emperador Ninjter el día que asumió el trono. No esperamos otra cosa que grandeza en su reinado.'\n[q0]Collar de escarabajo de esteatita\nSe liga al recogerlo"}
