MultiLanguageSpellData['es'][91782] = {name = "[q0]Mosaico de oasis diminuto", additional_info = "Hechizo de 3 seg 5\n[q]Esta pequeña pieza artística se ha unido a partir de azulejos de arcilla rotos de color turquesa brillante, verde y arena. \"¡Nuestras esperanzas y oraciones van al emperador Nintjer, para que pueda acabar con el hambre y restaure la gloria de los Ramkahen!\"\n[q0]Mosaico de oasis diminuto\nSe liga al recogerlo"}
