MultiLanguageSpellData['es'][91785] = {name = "[q0]Empuñadura de cimitarra grabada", additional_info = "Hechizo de 3 seg 5\n[q]Esta cimitarra parece más decorativa que útil. Su hoja mide solo unos pocos centímetros, pero no parece tener mucha utilidad en combate. Grabados alrededor del puño y la empuñadura puede leerse la frase: \"¡Que el Emperador Ninjter nos lleve a la victoria!¡Kadesh!¡Osad!¡Satekh!\".\n[q0]Empuñadura de cimitarra grabada\nSe liga al recogerlo"}
