MultiLanguageSpellData['es'][91790] = {name = "Vaso canope", additional_info = "Hechizo de 3 seg 5\n[q]Contiene los órganos petrificados del emperador Nintjer. Aparentemente murió tras solo unos pocos años de lo que se esperaba que se fuese un reinado glorioso.\nSe liga al recogerlo\n[q2]<Click derecho para abrir>"}
