MultiLanguageSpellData['es'][91793] = {name = "[q0]Pipa de Franclorn Forjador", additional_info = "Hechizo de 3 seg 5\n[q]Forjador fue un arquitecto popular del clan Hierro Negro. Supervisó, entre otras cosas, la construcción de la Presa de las Tres Cabezas y las Profundidades de Roca Negra. Se dice que aún se puede ver su fantasma dentro de la Montaña Roca Negra.\n[q0]Pipa de Franclorn Forjador\nSe liga al recogerlo"}
