MultiLanguageSpellData['es'][92137] = {name = "[q4]Garra trepadora", additional_info = "Hechizo de 3 seg 15\n[q]Una leyenda entre los tol'vir habla de un djinn retorcido al que juraron destruir los Ramkahen. En un intento por evitar su muerte, el djinn transfirió su espíritu al de un mono. Lo mataron justo en la mitad de la transferencia y solo una parte de su esencia se había trasladado: solo la suficiente para poseer la pata del mono.\n[q4]Garra trepadora\nSe liga al recogerlo\n[q2]Uso: Te enseña a invocar este compañero.\n[q2]Haz clic con el botón derecho del ratón para invocar y retirar a tu garra trepadora."}
