MultiLanguageSpellData['es'][92139] = {name = "[q4]Bastón de Ammunae", additional_info = "Hechizo de 3 seg 15\n[q]Ammunae es uno de los guardianes de las Cámaras de los Orígenes. Como los demás ensamblajes del interior de las cámaras, Ammunae fue creado para proteger el poderoso dispositivo del interior capaz de reiniciar toda la vida en Azeroth. Cada uno de los guardianes tiene una esfera de influencia: Isiset, la magia; Ammunae, la vida; Setesh, el caos; Rajh, el sol.\n[q4]Bastón de Ammunae\nSe liga a la cuenta\nDos manos Bastón\n1,196 - 1,795 Daño Velocidad 2.40\n(623.13 daño por segundo)\n+512 aguante\n+341 intelecto\n+247 espíritu\nDurabilidad 120 / 120\nNecesitas ser de nivel 85\n[q2]Equipar: Mejora el índice de golpe crítico en 194 p.\n[q2]Equipar: Aumenta el poder con hechizos 1.955 p.\n[q]\"Achusenmen osadi djahi kahun Ammunae\""}
