MultiLanguageSpellData['es'][92145] = {name = "[q4]Colgante de la tormenta del escarabajo", additional_info = "Hechizo de 3 seg 15\n[q]En el reino del faraón Tebhotep, una plaga de serpientes asoló el río Vir'naal. Nada logró expulsar a los reptiles. Entonces, apareció una segunda plaga, esta de escarabajos del desierto. Los escarabajos pelearon contra las serpientes hasta que no quedó ninguna de las dos criaturas y la paz volvió a la tierra.\n[q4]Colgante de la tormenta del escarabajo\nSe liga a la cuenta\nJuguete\n[q2]Uso: Invoca una tormenta de escarabajos pacíficos. (10 Min Reutilización)"}
