MultiLanguageSpellData['es'][92148] = {name = "[q4]Cetro de Azj'Aqir", additional_info = "Hechizo de 3 seg 15\n[q]Los aquir fueron una raza de insectos expansionistas increíblemente malvados que lucharon contra los imperios trol durante miles de años. Al final, la gran civilización Azj'Aqir se dividió en dos, con Azjol-Nerub en el norte y Ahn'Qiraj en el sur. Los elfos de la noche fueron capaces de contener a los qiraji durante muchos años hasta que los volvió a despertar el dios antiguo C'thun.\n[q4]Cetro de Azj'Aqir\nSe liga al recogerlo\nÚnico\nMontura\nNecesitas ser de nivel 40\nRequiereOficial jinete\n[q2]Uso: Te enseña a invocar al tanque de batalla qiraji ultramarino.\n[q2]Invoca y retira un tanque de batalla qiraji ultramarino."}
