MultiLanguageSpellData['es'][92163] = {name = "[q4]Cimitarra del siroco", additional_info = "Hechizo de 3 seg 15\n[q]Esta arma fue una vez parte de un conjunto de cimitarras forjadas por el famoso trabajador de bronce de los Ramkahen Irmaat. Cada una fue diseñada para representar uno de los señores de los djinn de los Cuatro Vientos. Sin embargo, se perdieron las cuatro cimitarras, aunque esta si se pudo reconstruir puede que aún haya esperanza para las demás.\n[q4]Cimitarra del siroco\nSe liga a la cuenta\nUna mano Espada\n841 - 1,563 Daño Velocidad 2.60\n(462.31 daño por segundo)\n+146 fuerza\n+219 aguante\nDurabilidad 105 / 105\nNecesitas ser de nivel 85\n[q2]Equipar: Mejora el índice de golpe crítico en 111 p.\n[q2]Equipar: Mejora el índice de celeridad en 74 p.\n[q]\"En el desierto, el viento tiene nombre...\""}
