MultiLanguageSpellData['es'][98556] = {name = "[q3]Tambor de guerra embrujado", additional_info = "Hechizo de 3 seg 15\n[q]Hace mucho tiempo, los tamborileros de guerra más dedicados se dejaban despellejar vivos para que utilizasen su piel en la elaboración de sus preciados instrumentos. Aunque que la increíble capacidad de regeneración de los trols les permitía sobrevivir a una atrocidad tal, era un proceso largo y tortuoso que volvía locos de dolor a algunos. Se dice que, si mataban a un tamborilero de guerra mientras tocaba el instrumento, su espíritu pasaba a formar parte de él...\n[q3]Tambor de guerra embrujado\nSe liga al recogerlo\nJuguete\n[q2]Uso: Coloca y escucha un tambor de guerra embrujado. (30 Min Reutilización)"}
