MultiLanguageSpellData['es'][98569] = {name = "[q3]Cuerno de beber vrykul", additional_info = "Hechizo de 3 seg 15\n[q]Al contrario que las creencias populares, los cuernos de beber vrykul no eran vasijas comunes. Mientras que la mayoría bebía hidromiel o cerveza en cuencos o copas, solo los que gozaban de gran prestigio bebían vino en elaborados cuernos como este. Incluso cuando se traspasaba una vasija de estas a un vrykul en cuestión, se celebraba una ceremonia que, normalmente, preparaban las mujeres de más alto rango junto con las declaraciones formales de rango y honores.\n[q3]Cuerno de beber vrykul\nSe liga al recogerlo\nJuguete\n[q2]Uso: Bebe del cuerno de beber vrykul."}
