MultiLanguageSpellData['es'][348704] = {name = "Sello de corrupción", additional_info = "14% del maná base\nInstante Requiere Paladín\n[q]Colma al paladín de poder sagrado, lo que provoca que los ataques apliquen Corrupción de sangre. Esto inflige [(0.013 * Spell power + 0.025 * Attack power) * 5] p. de daño Sagrado extra durante 15 sec. Corrupción de sangre se puede acumular hasta 5 veces. Cada uno de los ataques del paladín también infligirá hasta un 15% de daño con arma como daño Sagrado extra en función del número de acumulaciones. Un paladín solo puede tener un sello activo a la vez. Dura 30 min.\n\n Desatar la energía de este sello infligirá (1 + 0.22 * Spell power + 0.14 * Attack power) p. de daño Sagrado a un enemigo, que aumenta un 10% por cada aplicación de Corrupción de sangre sobre el objetivo."}
